import React, { useState, useEffect } from 'react';

function App() {
  const [url, setUrl] = useState('');
  const [quality, setQuality] = useState('720p');
  const [progressData, setProgressData] = useState({
    percent: '',
    downloaded: '',
    speed: '',
    eta: '',
    remaining: '',
  });
  const [logs, setLogs] = useState([]);
  const [isDownloading, setIsDownloading] = useState(false);
  const [estimatedSize, setEstimatedSize] = useState('');

  const startDownload = async () => {
    setIsDownloading(true);
    setLogs([]);
    setProgressData({});
    const eventSource = new EventSource(
      `http://localhost:8080/api/youtube/download/progress?url=${encodeURIComponent(url)}&quality=${quality}`
    );

    eventSource.onmessage = (e) => {
      const data = e.data;

      if (data.startsWith('SIZE::')) {
        const [, q, size] = data.split('::');
        setEstimatedSize(size);
        setLogs((prev) => [...prev, `📏 Estimated Size (${q}): ${size}`]);
      } else if (data.startsWith('PROGRESS::')) {
        const [, percent, downloaded, speed, eta, remaining] = data.split('::');
        setProgressData({
          percent,
          downloaded,
          speed,
          eta,
          remaining,
        });
      } else {
        setLogs((prev) => [...prev, data]);
      }

      if (data.includes('✅ Download completed')) {
        setIsDownloading(false);
        eventSource.close();
      } else if (data.startsWith('❌')) {
        setIsDownloading(false);
        eventSource.close();
      }
    };

    eventSource.onerror = () => {
      setIsDownloading(false);
      eventSource.close();
      setLogs((prev) => [...prev, '❌ Connection error or download interrupted.']);
    };
  };

  return (
    <div className="min-h-screen bg-gray-900 text-white p-6 flex flex-col items-center">
      <h1 className="text-3xl font-bold mb-6">🎥 YouTube Video Downloader</h1>

      <div className="bg-gray-800 p-6 rounded-xl shadow-md w-full max-w-xl mb-6">
        <input
          className="w-full p-3 mb-4 rounded-lg text-black"
          type="text"
          placeholder="Enter YouTube URL"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
        />

        <select
          className="w-full p-3 mb-4 rounded-lg text-black"
          value={quality}
          onChange={(e) => setQuality(e.target.value)}
        >
          {['8k', '4k', '1080p', '720p', '480p', '360p'].map((q) => (
            <option key={q} value={q}>{q}</option>
          ))}
        </select>

        <button
          onClick={startDownload}
          disabled={isDownloading || !url}
          className={`w-full p-3 rounded-lg font-semibold ${
            isDownloading ? 'bg-gray-500 cursor-not-allowed' : 'bg-green-600 hover:bg-green-700'
          }`}
        >
          {isDownloading ? 'Downloading...' : 'Download'}
        </button>
      </div>

      {progressData.percent && (
        <div className="bg-gray-800 p-6 rounded-xl shadow-md w-full max-w-xl mb-6">
          <h2 className="text-xl font-semibold mb-4">📊 Download Progress</h2>
          <p className="mb-2">🔁 <span className="text-yellow-400">Progress:</span> {progressData.percent}%</p>
          <p className="mb-2">📦 <span className="text-blue-300">Downloaded:</span> {progressData.downloaded}</p>
          <p className="mb-2">🚀 <span className="text-green-400">Speed:</span> {progressData.speed}</p>
          <p className="mb-2">⏳ <span className="text-purple-400">ETA:</span> {progressData.eta}</p>
          <p className="mb-2">📉 <span className="text-red-400">Remaining:</span> {progressData.remaining}</p>
        </div>
      )}

      <div className="bg-gray-800 p-4 rounded-xl w-full max-w-xl overflow-y-auto max-h-60">
        <h2 className="font-semibold text-lg mb-2">📄 Logs</h2>
        {logs.map((log, index) => (
          <div key={index} className="text-sm text-gray-300">
            {log}
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
